import React from 'react';

import style from './Style.css';
import Card from './Card';

class ProblemLevel extends React.Component {
    render(){
        return(
            <div className="section">
            <div className="hero">
                <div className="cont">
                    <h1>Practice More And Level up Fast</h1>
                    <p>Learn Data Structures and Algorithms from basic to advanced level

                    </p>

                </div>
            </div>
            <div className="cards">
                <Card img={'https://appodeal.com/wp-content/uploads/2020/12/meetstack-1280x640-1.jpg'} value={'Arrays'} title={'Array'} description={'Basic level Data Structures and Algorithms'}/>
                <Card img={'https://appodeal.com/wp-content/uploads/2020/12/meetstack-1280x640-1.jpg'} value={'Stacks'} title={'Stack'} description={'Intermediate level Data Structures and Algorithms'}/>
                <Card img={'https://miro.medium.com/max/2416/0*4Id-3IMNQHihLJAg.png'} value={'Linked List'} title={'Linked List'} description={'Advance level Data Structures and Algorithms'}/>
                <Card img={'https://camo.githubusercontent.com/43458d3140725009309bd93ba836f29581a2b75082315c67de45fbe737e13258/68747470733a2f2f63646e2d696d616765732d312e6d656469756d2e636f6d2f6d61782f313630302f312a4b4945444730314f503445474b48694b754b572d64412e706e67'} value={'Trees'} title={'Trees'} description={'Advance level Data Structures and Algorithms'}/>
                <Card img={'https://appodeal.com/wp-content/uploads/2020/12/meetstack-1280x640-1.jpg'} value={'Graphs'} title={'Graphs'} description={'Advance level Data Structures and Algorithms'}/>
            </div>
            </div>
        )
    }
}

export default ProblemLevel;
